export default (function(a,b,c,d,e,f,g,h){return {data:{PU4NV5KwnM:{data:{id:1684,attributes:{imdbId:"tt5091014",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMzZjMjA4NjgtZTFjNy00NzVkLTkyNDgtM2NkNDAxZTQ2NzZlL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNTU2OTI3Mzc@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.5\u002F10"},{Source:"Rotten Tomatoes",Value:"78%"}],item_lang:{data:{id:2347,attributes:{title:b,plot:"JASPER JONES is a coming of age story about Charlie Bucktin, a bookish boy of 14. On the night that Jasper Jones, the town's mixed race outcast shows him the dead body of young Laura Wishart, Charlie's life is changed forever. Entrusted with this secret and believing Jasper to be innocent, Charlie embarks on a dangerous journey to find the true killer. Set over the scorching summer holidays of 1969, Charlie defeats the local racists, faces the breakup of his parents and falls head over heels in love as he discovers what it means to be truly courageous.",slug:"jasper-jones"}}},books:{data:[{id:8710,attributes:{title:b,description:e,thumbnail:f,authors:[c],firstBook:true,published:g,publisher:h,subtitle:a}},{id:8711,attributes:{title:b,description:e,thumbnail:f,authors:[c],firstBook:d,published:g,publisher:h,subtitle:a}},{id:8712,attributes:{title:b,description:"Late on a hot summer night in 1965, Charlie Bucktin, a precocious and bookish boy of fourteen, is startled by an urgent knock on the window of his sleep-out. His visitor is Jasper Jones, an outcast in the regional mining town of Corrigan. Rebellious, sixteen years old, mixed-race and solitary, Jasper is a distant figure of danger and intrigue for Charlie. So when Jasper begs for his help, Charlie eagerly steals into the night by his side, terribly afraid but desperate to impress. Jasper takes him to his secret glade in the bush, and its here that Charlie bears witness to Jaspers horrible discovery. In the simmering summer where everything changes, Charlie learns why the truth of things is so hard to know, and even harder to hold in his heart.",thumbnail:a,authors:[c],firstBook:d,published:"2016-01-01",publisher:a,subtitle:"Based on the Novel by Craig Silvey"}},{id:8713,attributes:{title:b,description:"Late on a hot summer night in the tail end of 1965, Charlie Bucktin, a precocious and bookish boy of thirteen, is startled by an urgent knock on the window of his sleepout. His visitor is Jasper Jones, an outcast in the regional mining town of Corrigan.",thumbnail:a,authors:[c],firstBook:d,published:"1000-01-01",publisher:"Dyslexic Books",subtitle:"A novel"}},{id:8714,attributes:{title:"Honeybee",description:"The highly anticipated new novel by the bestselling author of Jasper Jones.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=uumXzQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2020-09-29",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940964104}}("","Jasper Jones","Craig Silvey",null,"A 2012 Michael L. Printz Honor Book Charlie Bucktin, a bookish thirteen year old, is startled one summer night by an urgent knock on his bedroom window. His visitor is Jasper Jones, an outcast in their small mining town, and he has come to ask for Charlie's help. Terribly afraid but desperate to impress, Charlie follows him into the night. Jasper takes him to his secret glade, where Charlie witnesses Jasper's horrible discovery. With his secret like a brick in his belly, Charlie is pushed and pulled by a town closing in on itself in fear and suspicion. He locks horns with his tempestuous mother, falls nervously in love, and battles to keep a lid on his zealous best friend. In the simmering summer where everything changes, Charlie learns why the truth of things is so hard to know, and even harder to hold in his heart.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=qGbeOCV-FgAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2011-04-05","Knopf Books for Young Readers"))